import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Welcome to training hub!
        <p></p>
        <img src="https://www.freeiconspng.com/thumbs/exercise-icon/exercise-icon-1.png"className="App-logo" alt="logo" />
        <table></table>
      </header>
    </div>
  );
}

export default App;
